import React from "react";
import Note from "../Note/note";

const NotesList = () => {
  const notes = [
    { id: 1, title: "First Note", description: "This is the first note" },
    { id: 2, title: "Second Note", description: "This is the second note" },
    { id: 3, title: "Third Note", description: "This is the third note" },
  ];

  return (
      <div className="mx-auto w-full max-w-4xl p-6">
        <h1 className="mb-6 text-center text-3xl font-bold">Notes Application</h1>
        <div className="grid grid-cols-1 gap-6 md:grid-cols-2 lg:grid-cols-3">
          {notes.map((note) => (
              <Note                  key={note.id}
                  title={note.title}
                  description={note.description}
              />
          ))}
        </div>
      </div>
  );
};

export default NotesList;
